        "#FFDFD9",
        "#E6FFD9",
        "#E8D9FF",
        "#FFEBD9",
        "#D9FFFC",
        "#FFF5D9",
        "#D9FFE5",
        "FFD9ED",
        "#E0FFD9",
        "#D9F2FF",
    ]

    const changeColor = () => setColor = pastelColors[Math.random(pastelColors.lenght)]
    console.log(changeColor)

    return (
        <div onClick={changeColor} style={{backgroundColor: changeColor}} className="box">bla</div>
    )
}
